medication in Europe) This project investigated the reasons why opioid medication was inadequately used for moderate to severe pain in twelve European countries and provided evidence to support improved access to opioids The EAPC is also represented on the European Commission funded Civil Society Forum on Drugs Whilst much of the work of this group focuses on the tackling the issue of illicit use of drugs, the EAPC provides an expert voice on access to opioids for pain management for those requiring palliative care We are also currently lobbying to establish a Civil Society Forum on Palliative Care in order to advocate and lobby for access to and improvements in palliative care across Europe In 2019, the WHO withdrew two sets of guidelines on the use of opioids, one in children and the other in adults The EAPC was involved the establishment of new and updated guidelines','2025-01-18 16:41:25'),(388,'Políticas e instrumentos de financiación de la Dirección General de Desarrollo y Cooperación de la Comisión Europea, especialmente, los relacionados con los Actores No Estatales y las Autoridades Locales','2025-01-18 16:41:26'),(389,'REGULATION (EC) No 1905/2006 OF THE EUROPEAN PARLIAMENT AND OF THE COUNCIL (18/12/2006)','2025-01-18 16:41:26'),(390,'Además, damos seguimiento al proceso legislativo de la Comisión de Desarrollo en el Parlamento Europeo','2025-01-18 16:41:26'),(391,'Rail Passenger Rights','2025-01-18 16:41:26'),(392,'Multi-modal passenger rights','2025-01-18 16:41:26'),(393,'PSI Directive','2025-01-18 16:41:26'),(394,'CRS Consultation','2025-01-18 16:41:26'),(395,'Open Data Directive','2025-01-18 16:41:26'),(396,'GDPR','2025-01-18 16:41:26'),(397,'Travel Package Directive','2025-01-18 16:41:26'),(398,'Pricing Transparency','2025-01-18 16:41:26'),(399,'Consumer Directive','2025-01-18 16:41:26'),(400,'PSD2','2025-01-18 16:41:26'),(401,'Die IHK Nord verfolgt europäische Initiativen zu ihren Schwerpunktbereichen Maritimes und Infrastruktur, Energie- und Industriepolitik, Tourismus, Ernährungswirtschaft und Außenwirtschaft, die für die gewerbliche Wirtschaft Norddeutschlands von Bedeutung sind Hinsichtlich des Schwerpunktthemas Maritimes und Infrastruktur liegen die Arbeitsschwerpunkte der IHK Nord in den Bereichen Schifffahrt und Logistik, maritime Infrastruktur sowie kohlenstoffarme Treibstoffe in der Schifffahrt und Landstrom Die IHK Nord verfolgt insbesondere die Einbeziehung des Seeverkehrs in den Europäischen Emissionshandel, die FuelEU Maritime Initiative zu kohlenstoffarmen Treibstoffen in der Schifffahrt sowie die Verordnung zu transeuropäischen Verkehrsnetzen (TEN-V) Bezüglich der Energie- und Industriepolitik verfolgt die IHK Nord die Themen Offshore Windenergie und Wasserstoff, konkret die europäische Offshore Strategie und die europäische Wasserstoffstrategie sowie verbundene Initiativen des Green Deal Im Bereich des Tourismus begleitet die IHK Nord europäische Initiativen mit Relevanz zum Tourismus an den norddeutschen Küsten, beispielsweise die Initiative zu kurzfristigen Vermietungen In der Ernährungswirtschaft liegt der Fokus auf den Themen Farm-to-Fork sowie Lebensmittelkennzeichnung, konkret die Themen geschützte geografische Angaben sowie Nutri-Score Der Arbeitsschwerpunkt Außenwirtschaft wird durch den Brexit sowie die Geoökonomie geprägt, darüber hinaus verfolgt die IHK Nord Initiativen im Bereich Zoll und Export','2025-01-18 16:41:27'),(402,'Due Diligence, sustainability, waste remediation, wasted management, soil contamination, water pollution, air pollution','2025-01-18 16:41:27'),(403,'Single European Sky, Aviation package, Wise Persons Group Report, Airspace Architecture Study','2025-01-18 16:41:28'),(404,'-EU Transport policies (Air, Sea, Land)','2025-01-18 16:41:29'),(405,'-EU Energy policies','2025-01-18 16:41:29'),(406,'-EU Digital policies','2025-01-18 16:41:29'),(407,'Examples:','2025-01-18 16:41:29'),(408,'-ReFuel EU Aviation,','2025-01-18 16:41:29'),(409,'-FuelEU Maritime,','2025-01-18 16